import React from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <React.Fragment>
      <header className="float-left flex flex-col text-center bg-purple-900 w-1/3">
        <div className="logo font-black text-6xl text-purple-900">
          Weather
          <br />
          App
        </div>
        <nav className="flex flex-col justify-center text-6xl text-white">
          <Link to="/">Home</Link>
          <Link to="/favourite-places">Favourite places</Link>
          <Link to="/help">Help</Link>
          <SearchBox value={searchQuery} onChange={onSearch} />
        </nav>
      </header>
    </React.Fragment>
  );
};

export default NavBar;
